import React from 'react';

function review({data}) {
    return (

        data.map(
            {
                first_name: data.first_name,
                last_name: data.last_name,
                email: data.email,
                topic: data.topic,
                contact_comment: data.contact_comment
            }
        )
    )
}

export default review
